import React from 'react'
import Card from 'react-bootstrap/Card';
import { useLocation } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import {useState} from 'react';

function Media(props) {
console.log(props);
const navigate=useNavigate();
const [show, setShow] = useState(false);

const handleClose = () => setShow(false);
const handleShow = () => setShow(true);
  return (
    <>
    <div style={{display:"flex", justifyContent:"center",alignContent:"center"}}>
 <Card style={{width:"500px",height:"350px",}}>
      <Card.Header style={{textAlign:"center"}}>ITEM(S) ADDED</Card.Header>
      <Card.Body>
        {/* <Card.Title>Special title treatment</Card.Title>
        <Card.Text>
          With supporting text below as a natural lead-in to additional content.
        </Card.Text> */}

<Card>
      {/* <Card.Header>Featured</Card.Header> */}
      <Card.Body>
        <Card.Title>{props.data.symbol}{props.data.name}</Card.Title>
        <Card.Text>
         cost:₹{props.data.val}
        </Card.Text>
        <Card.Text>
          Quantity:{props.data.count}
        </Card.Text>
      </Card.Body>
    </Card>


    <Card style={{marginTop:"10px"}}>
     
     <Card.Body>
       <Card.Text style={{borderBottom:"1px dashed grey",paddingBottom:"10px"}} onClick={()=>{navigate("/")}}><i class="fa fa-plus-circle" aria-hidden="true"></i>Add more items<span style={{paddingLeft:"270px"}}><i class="fa fa-arrow-right" aria-hidden="true"></i></span></Card.Text>
       <Card.Text onClick={handleShow}><i class="fa fa-pencil-square-o" aria-hidden="true"></i>Add Cooking instructions<span style={{paddingLeft:"200px"}}><i class="fa fa-arrow-right" aria-hidden="true"></i></span></Card.Text>
       <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title style={{color:"red"}}>Special cooking instructions </Modal.Title>
        </Modal.Header>
        <Modal.Body>
        {/* <input type='text' placeholder='Start typing...' /> */}
        <textarea placeholder="Start typing..." cols={60} rows={4}></textarea>

        <p style={{color:"red",marginTop:"20px"}}>The restaurant will try their best to follow your instructions.However,no cancellation or refund will be possible if your request is not met</p>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose} style={{width:"470px"}}>
            Add
          </Button>
          {/* <Button variant="primary">Understood</Button> */}
        </Modal.Footer>
      </Modal>

     </Card.Body>
   </Card>


  
      
      </Card.Body>
    </Card>


    <Card style={{width:"500px",height:"350px",}}>
      <Card.Header style={{textAlign:"center"}}>SAVINGS CORNER</Card.Header>
      <Card.Body>
        {/* <Card.Title>Special title treatment</Card.Title>
        <Card.Text>
          With supporting text below as a natural lead-in to additional content.
        </Card.Text> */}

<Card>
      {/* <Card.Header>Featured</Card.Header> */}
      <Card.Body >
        {/* <Card.Title>{props.data.symbol}{props.data.name}</Card.Title> */}
        <Card.Text>
        Save ₹120 more on this order
        </Card.Text>
        <Card.Text style={{display:"flex"}}>
          Code:TREAT
          <p style={{color:"red",marginLeft:"280px",}}>Apply</p>
        </Card.Text>
        <Card.Text style={{color:"red",borderTop:"1px dashed grey",marginTop:"-26px",paddingTop:"10px"}} onClick={()=>{navigate("/coupons")}}>
        View all coupons
        </Card.Text>
        
      </Card.Body>
    </Card>


    <Card style={{marginTop:"10px"}}>
     
     <Card.Body>
       <Card.Text style={{borderBottom:"1px dashed grey",paddingBottom:"10px"}} onClick={()=>{navigate("/")}}><i class="fa fa-plus-circle" aria-hidden="true"></i>Add more items<span style={{paddingLeft:"270px"}}><i class="fa fa-arrow-right" aria-hidden="true"></i></span></Card.Text>
       <Card.Text onClick={handleShow}><i class="fa fa-pencil-square-o" aria-hidden="true"></i>Add Cooking instructions<span style={{paddingLeft:"200px"}}><i class="fa fa-arrow-right" aria-hidden="true"></i></span></Card.Text>
       <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title style={{color:"red"}}>Special cooking instructions </Modal.Title>
        </Modal.Header>
        <Modal.Body>
        {/* <input type='text' placeholder='Start typing...' /> */}
        <textarea placeholder="Start typing..." cols={60} rows={4}></textarea>

        <p style={{color:"red",marginTop:"20px"}}>The restaurant will try their best to follow your instructions.However,no cancellation or refund will be possible if your request is not met</p>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose} style={{width:"470px"}}>
            Add
          </Button>
          {/* <Button variant="primary">Understood</Button> */}
        </Modal.Footer>
      </Modal>

     </Card.Body>
   </Card>


  
      
      </Card.Body>
    </Card>


  
      
     
 
      
     
    </div>
    </>
  )
}


function Cart() {
  const location=useLocation();   
  const val1=location.state.val;
  const name1=location.state.name
  const symbol1=location.state.symbol;
  const count1=location.state.count
  console.log(val1,name1);
  let a={val:val1,name:name1,symbol:symbol1,count:count1}

  const handlelogout=async()=>{
    const result=await(await fetch("http://localhost:9000/rest/logout",{
      method:"POST",
      credentials:"include"
    })).json()
    
    console.log(result);
    // .then(res=>console.log(res.json()))
    // .then(a=>console.log(a))
    localStorage.setItem("token","")
     }
  return (
   <>
   <div className="head container">

   
<img src='https://mir-s3-cdn-cf.behance.net/projects/404/2971a3169377049.Y3JvcCwxMDgwLDg0NCwwLDExNw.png' style={{width:"190px",height:"160px",marginTop:"-40px"}} />

 {/* {localStorage.getItem("token")&&<h4>Welcome {((JSON.parse(localStorage.getItem("token"))).email)} {console.log((JSON.parse(localStorage.getItem("token"))).email)} </h4>
} */}

<ul className="list"> 
{/* <li><a href="/cart"><i class="fa fa-shopping-cart" aria-hidden="true"></i></a></li> */}
   <li><a href="/" onClick={handlelogout} >Logout</a></li>
   
   </ul>
</div>




<div>
      {/* <Media loading /> */}
      <Media data={a} />
    </div>

   </>
  )
}

export default Cart
